                this.classList.toggle('empty', this.pieces.length === 0);
                const isActive = (state.markedPiece?.hidden ?? false) && state.markedPiece?.type === piece;
                this.classList.toggle('active', isActive); // 如果有标记的棋子，设置背景色为红色
